import React from "react";
import {Logout} from "../logout/Logout";
import "./header.css";
// import logo from "../../../public/img/logo.png";

export const Header = () => {
    return (

        <div className="header">
            <div className="logout">
                <a href="#">
                <img className="logout"
                     src="https://www.pngitem.com/pimgs/m/252-2523180_transparent-clipart-windows-logout-icon-png-red-png.png"
                     // src="https://www.pngitem.com/pimgs/m/252-2523180_transparent-clipart-windows-logout-icon-png-red-png.png"
                     alt="logout"/>
                </a>
            </div>
            <h1><img className="logo" src="https://www.homesteadletters.com/wp-content/uploads/2010/07/yck7BoXcE.jpeg" alt=""/></h1>
        </div>
    )
};
